import React from "react";
import Motor3d from "../generalLayout/motor3d";
import PageName from "../generalLayout/pageName";
import MotorPageHeader from "../generalLayout/motorPageHeader";
import { ScrollNavFunction } from "../generalFunctionForOnScroll/ScrollEventFor_MotorPage";
import { FooterGe } from "../generalLayout/footer_test";
import MvEmail from "../generalLayout/mvEmail";
import { NavWhiteCompact } from "../generalFunctionForOnScroll/ScrollEventFor_Homepage";
import Nav from "../generalLayout/nav";
import NavDesktop from "../generalLayout/navDesk";
const heroGradientStart = "#252524";
const heroGradientEnd = "#222121";
const dragster800rosso_infor = {
  namePage: "Dragster 800 Rosso",
  price: "13.400",
  nameHeaderTitle: "dragster800rosso/dragster-800-rosso.svg",
  bgHeaderParallax: "dragster800rosso/dragster-800-rosso-xl.png",
  manifesto_Arr: ["YOUR", "DREAM", "STARTS", "HERE"],
  colorBg: `linear-gradient(90deg,${heroGradientStart} 0%,${heroGradientEnd} 100%)`,
  contentHeaderContent:
    "All the guts, the power and the character of a true Dragster. Accessible, pure riding pleasure.",
  Model3ds: [
    {
      link: "dragster800rosso/original/dragster800rosso",
      color:
        "linear-gradient(45deg, rgba(45,0,12,1) 25%, rgba(121,9,9,1) 50%, rgba(255,0,0,1) 100%)",
      nameOfColor: "ahihi",
    },
    {
      link: null,
      color: null,
      nameOfColor: "null"
    }
  ],
};
export default function Dragster800Rosso() {
  window.addEventListener("scroll", () => {
    ScrollNavFunction();
    NavWhiteCompact();
  });
  return (
    <>
      <div
        className="nav-pc-homepage"
        style={{
          height: "84px",
          width: "100vw",
          background: colorBg,
        }}
      ></div>
      <NavDesktop />
      <Nav color="white" />
      <PageName namePage={namePage}></PageName>
      <MotorPageHeader
        manifesto_Arr={manifesto_Arr}
        nameHeaderTitle={nameHeaderTitle}
        titleSize="auto 18%"
        colorBg={colorBg}
        contentHeaderContent={contentHeaderContent}
        price={price}
        bgHeaderParallax= "g"
        reveredContent={false}
        heightContentTop= "14.5%"
      />
      <Motor3d
        imgLocate="dragster800rosso/dragster800rosso"
        nameModel="MV AGUSTA DRAGSTER 800 ROSSO"
        price={price}
      />
      <MvEmail></MvEmail>
      <br />
      <FooterGe />
    </>
  );
}
